INSERT INTO `article` (`ArticleID`, `ArticleName`, `ArticleText`) VALUES
	(3, 'Deployment Automation', '<p><strong style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);">Deployment automation</strong><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);">&nbsp;is what enables you to&nbsp;</span><strong style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);">deploy</strong><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);">&nbsp;your software to testing and production environments with the push of a button. ... Scripts to configure the environment,&nbsp;</span><strong style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);">deploy</strong><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);">&nbsp;the packages, and perform a&nbsp;</span><strong style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);">deployment</strong><span style="background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);">&nbsp;test (sometimes known as a smoke test). Environment-specific configuration information.</span></p><p><br></p><p><img src="data:image/png;base64,"></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);">Distributing software to all machines in a network can be a daunting task for IT Administrators, especially at large enterprises. With an ever-growing number of endpoints, it is becoming a real challenge to roll out software across organizations. Desktop Central allows you to distribute software packages and automate deployment in all the computers across your network across&nbsp;</span><a href="https://www.manageengine.com/products/desktop-central/windows-software-installation.html" rel="noopener noreferrer" target="_blank" style="background-color: rgb(255, 255, 255); color: rgb(0, 153, 204);">Windows</a><span style="background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);">,&nbsp;</span><a href="https://www.manageengine.com/products/desktop-central/mac-software-deployment.html" rel="noopener noreferrer" target="_blank" style="background-color: rgb(255, 255, 255); color: rgb(0, 153, 204);">Mac</a><span style="background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);">&nbsp;and&nbsp;</span><a href="https://www.manageengine.com/products/desktop-central/linux-software-deployment.html" rel="noopener noreferrer" target="_blank" style="background-color: rgb(255, 255, 255); color: rgb(0, 153, 204);">Linux</a><span style="background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);">&nbsp;from a central console, without user intervention.&nbsp;</span></p><p><br></p><p><img src="data:image/png;base64,"></p>'),
	(4, 'Node.js Express Tutorial', '<p>This is a tutorial on the Express web middleware which <em><u>greatly </u></em>facilitates use of Node.js as a Web or API server.</p><p><br></p><p class="ql-align-center"><strong><u>Remember to escape values for DB operations!</u></strong></p><p class="ql-align-center"><br></p><blockquote>This is a block quote area</blockquote><blockquote>This is quite easy to use</blockquote><p><br></p><p>Notice the bar to the left</p>'),
	(39, 'Learn The Key to Bug Free Code', '<p>The key is not to write any bugs.  But, if you do write any bugs, you should fix them.</p>'),
	(40, 'AWS EC2 vs. Lightsail!', '<p>Amazon AWS services offer a ton of options.</p>'),
	(57, 'CSS Flex Tutorial', '<p>CSS Flex is a very powerful feature of CSS that replaces alternative and somewhat awkward methods of positioning elements.</p>'),
	(60, 'Vue Cheat Sheet', '<p>lite_server</p><p>https://jsonplaceholder.typicode.com/</p><p><br></p><p>VIEW TOPICS</p><p><br></p><p>	Directives</p><p>	Data, Methods</p><p>	Computed, Watch</p><p>	Life Cycle Events</p><p>	Components</p><p>	Events</p><p>	Vue CLI</p><p>	Router</p><p>	Single File Components</p><p><br></p><p><br></p>'),
	(61, 'JavaScript Array Methods', '<p>JavaScript has a very robust library of methods for manipulating arrays.</p>'),
	(62, 'SQL Cheat Sheet', '<p>CREATE TABLE</p><p>SELECT</p><p>INSERT</p><p>DELETE</p><p><br></p>'),
	(63, 'Authentication with JWT', '<p>SUMMARY</p><p><br></p><p>Client logs in and gets JWT</p><p>Client places JWT in HTTP Authorization header for subsequent requests</p><p>Server checks to ensure JWT is valid, then unpacks user from JWT and procedes with processing for that user</p><p><br></p>'),
	(78, 'Upload Errors', '<p>Error: (conn=2344, no: 1366, SQLState: 22007) Incorrect string value: \'xEFxBBxBF&lt;/s...\' for column `dev`.`article`.`ArticleText` at row 1</p><p><br></p><p>function readStream (stream, encoding, length, limit, callback) {</p><p>&nbsp;var complete = false</p><p>&nbsp;var sync = true</p><p><br></p><p>&nbsp;// check the length and limit options.</p><p>&nbsp;// note: we intentionally leave the stream paused,</p><p>&nbsp;// so users should handle the stream themselves.</p><p>&nbsp;if (limit !== null &amp;&amp; length !== null &amp;&amp; length &gt; limit) {</p><p>&nbsp;&nbsp;return done(createError(413, \'request entity too large\', {</p><p>&nbsp;&nbsp;&nbsp;expected: length,</p><p>&nbsp;&nbsp;&nbsp;length: length,</p><p>&nbsp;&nbsp;&nbsp;limit: limit,</p><p>&nbsp;&nbsp;&nbsp;type: \'entity.too.large\'</p><p>&nbsp;&nbsp;}))</p><p>&nbsp;}</p><p><br></p><p>size: 117111</p>');
